  Code = "class Solution:\n    def isPalindrome(self, x: int) -> bool:\n        if x < 0:\n            return False\n        \n        if x < 10:\n            return True\n        \n        number = []\n\n        while True:\n            remainder = x % 10\n            x = int(x / 10)\n            number.append(remainder)\n            if not x:\n                break\n            \n        \n        number.reverse()\n        print(number)\n        length = len(number)\n        half_index = int(length / 2)\n\n        for i, digit in enumerate(number):\n            last_digit = number[length - i - 1]\n\n            if digit != last_digit:\n                return False\n            \n            if i != half_index:\n                continue\n            \n            return True\n"
